javascript:(function(){const EMAIL='danielphua@era.com.sg';const PASSWORD='$S62801600e';const REMOVE_AFTER_MS=2000;const FADE_MS=120;function fadeOutAndRemove(el,d){el.style.transition='opacity '+d+'ms ease';el.style.opacity='0';const cleanup=()=>el.remove();el.addEventListener('transitionend',cleanup,{once:true});setTimeout(()=>el.isConnected&&cleanup(),d+100)}const overlay=document.createElement('div');overlay.id='projectsg-overlay';Object.assign(overlay.style,{position:'fixed',inset:'0',width:'100%',height:'100%',backgroundColor:'#000',color:'#fff',fontSize:'24px',display:'flex',alignItems:'center',justifyContent:'center',zIndex:'2147483647',pointerEvents:'all',opacity:'0',transition:'opacity '+FADE_MS+'ms ease'});overlay.textContent='Signing in with ProjectSG';document.body.appendChild(overlay);void overlay.offsetHeight;overlay.style.opacity='1';const emailField=document.querySelector('input.van-field__control[placeholder="Please enter email address"]');const passField=document.querySelector('input.van-field__control[type="password"]');const submitBtn=document.querySelector('button.login_btn');if(emailField){emailField.focus();emailField.value=EMAIL;emailField.dispatchEvent(new Event('input',{bubbles:true}))}if(passField){passField.focus();passField.value=PASSWORD;passField.dispatchEvent(new Event('input',{bubbles:true}))}if(submitBtn){submitBtn.click()}const removeOverlay=()=>{const el=document.getElementById('projectsg-overlay');if(el)fadeOutAndRemove(el,FADE_MS)};window.addEventListener('pageshow',removeOverlay,{once:true});setTimeout(removeOverlay,REMOVE_AFTER_MS)})();
